import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import {Route, Router, Routes} from "react-router-dom";
import Posts from "./components/pages/Posts";
import Promo from "./components/pages/Promo";

function App() {
    return (
        <Router>
                <Route path="/posts">
                    <Posts/>
                </Route>
                <Route path="/promo">
                    <Promo/>
                </Route>
        </Router>
    );
}

export default App;
